    display: -webkit-flex !important;
    display: -ms-flexbox !important;
    display: flex !important;
    -webkit-box-orient: vertical;
    -webkit-box-direction: normal;
    -webkit-flex-direction: column;
        -ms-flex-direction: column;
            flex-direction: column;
}

#wrapper {
    -webkit-box-flex: 1;
    -webkit-flex: 1 0 auto;
        -ms-flex: 1 0 auto;
            flex: 1 0 auto;
}

#wrapper, #background, #headerB {
    background: transparent;
    width: 100%;
    padding: 0;
}

#headerB, #background {
    height: auto;
}

#header {
    display: none;
}

.menu {
    background: -webkit-linear-gradient(rgba(187,17,119,.9) 0, #b17 75%, #b17 100%);
    background: linear-gradient(rgba(187,17,119,.9) 0,#b17 75%,#b17 100%);
    margin: 0;
    left: auto;
    right: auto;
    height: 100%;
	width: 100%;
}

#navigation0 {
    height: 90px;
    width: 100%;
    margin: 0;
    left: inherit;
    background: url(http://new.ppy.sh/images/layout/nav-backgrounds/triangles-1.png), url(http://new.ppy.sh/images/layout/nav-backgrounds/triangles-2.png), url(http://new.ppy.sh/images/layout/nav-backgrounds/triangles-3.png);
}

.menu > ul {
    -webkit-align-self: center;
    -ms-flex-item-align: center;
    align-self: center;
    margin-left: auto;
    margin-right: auto;
    width: calc(100% - 0px);
    display: -webkit-box;
    display: flex;
    display: -webkit-flex;
    display: -ms-flexbox;
    padding: 20px 20px 0;
    height: 80px;
    font-weight: 300;
    font-size: 14px;
    word-spacing: -0.25em;
    position: relative;
}

.menu > ul:before {
    z-index: 2;
    background: url('data:image/png;base64,');
    width: 100px;
    height: 100px;
    margin-top: -10px;
    content: " ";
    display: block;
}

.menu ul li {
    margin: 0 2px;
    padding: 0 4px;
}

.menu ul li a {
    width: auto;
    color: rgba(255,255,255,.8);
    -webkit-transition: color 80ms linear;
            transition: color 80ms linear;
    margin: 0;
    padding: 0;
}

.menu ul li a font[color] {
    font-weight: 700;
}

.menu  ul  li:hover a {
    color: rgba(255,255,255,.8);
    font-size: inherit;
}

.menu  ul  li  a:hover {
    color: #fff !important;
    font-size: inherit;
}

.menu ul li:hover ul {
    color: #fff;
    height: 40px !important;
    line-height: 30px;
    font-size: 18px !important;
    position: absolute;
    top: 50px;
    -webkit-align-self: center !important;
    -ms-flex-item-align: center !important;
    align-self: center !important;
    margin-top: 0;
    margin-left: auto !important;
    margin-right: auto !important;
    width: calc(100% - 0px);
    display: -webkit-box;
    display: flex;
    display: -webkit-flex;
    display: -ms-flexbox;
    left: 50%;
    -ms-transform: translateX(-50%);
        transform: translateX(-50%);
    -webkit-transform: translateX(-50%);
    -moz-transform: translateX(-50%);
    max-width: 1150px !important;
}

.menu ul li:hover ul li a:hover {
    background: transparent;
}

.menu ul li:hover ul li a {
    width: auto;
    margin: 0;
    color: rgba(255,255,255,.8);
}

.menu > ul > li:last-child {
    right: 0;
    position: absolute;
    font-size: 22px;
    padding: 0 20px;
    color: #fff;
    white-space: nowrap;
    cursor: default;
    margin: -5px 0 0 0;
}

.menu > ul > li:last-child ul {
    display: -webkit-box !important;
    display: -webkit-flex !important;
    display: -ms-flexbox !important;
    display: flex !important;
    right: 0px !important;
    left: auto !important;
    width: auto !important;
    top: 30px;
    position: absolute;
    -ms-transform: none;
        transform: none;
    -webkit-transform: none;
    -moz-transform: none;
    color: #fff;
    height: 40px;
    line-height: 30px;
    font-size: 14px !important;
    padding: 0 16px;
}

#foot {
    margin-top: 20px;
    bottom: 0px;
    padding: 10px 0 5px;
    font-size: 12px;
    background-color: rgba(0,0,0,.6);
    background-image: -webkit-linear-gradient(top, rgba(0,0,0,.6) 0, transparent 4px);
    background-image: linear-gradient(to bottom,rgba(0,0,0,.6) 0,transparent 4px);
    color: #ccc;
    height: auto;
}

#footer {
    height: auto;
}

#gotop {
    position: fixed;
}

#copyright {
    padding: 0;
}

@media (min-width: 840px) {
.menu > ul {
    width: calc(100% - 80px);
    max-width: 1350px;
}
.menu ul li:hover ul {
    width: calc(100% - 80px);
    max-width: 1150px;
}
}
}

@-moz-document url-prefix("http://ihome.ust.hk/~msssug/") {
#BGofIndex:before {
    content: '香港科技大學內地學生學者聯誼會本科部\AMainland Students and Scholars Society, UG Section';
    width: calc(100% - 0px);
    max-width: 1350px;
    color: #fff;
    position: relative;
    -webkit-align-self: center;
    -ms-flex-item-align: center;
    align-self: center;
    margin-left: auto;
    margin-right: auto;
    display: -webkit-box;
    display: flex;
    display: -webkit-flex;
    display: -ms-flexbox;
    background-image: url(http://new.ppy.sh/images/headers/forum-top.jpg);
    background-size: cover;
    height: 200px;
    font-size: 22px;
    padding: 122px 0 0 8%;
    box-sizing: border-box;
    white-space: pre;
    text-shadow: 0 1px 3px rgba(0,0,0,.75);
    box-shadow: 0 1px 3px rgba(0,0,0,.25);
}


#BGofIndex {
    top: -10px;
}

#entries {
    width: calc(100% - 0px);
    max-width: 1360px;
    color: #fff;
    position: relative;
    -webkit-align-self: center;
    -ms-flex-item-align: center;
    align-self: center;
    margin-left: auto;
    margin-right: auto;
    left: auto;
    margin-top: 10px;
}

.entry {
    width: 50% !important;
    box-sizing: border-box;
    padding: 0 5px;
    background-clip: content-box;
    margin: 0;
    margin-bottom: 10px;
    margin-top: 0 !important;
    background: transparent !important;
    position: relative;
    color: #fff;
}

.entry_BG {
    background: transparent !important;
    margin: 0 !important;
    height: auto !important;
    width: auto! important;
}

.entry, .entry:visited, .entry a, .entry a:visited, .entry a:hover, .entry:hover {
    color: #fff !important;
    background: transparent !important;
}


.entry:before {
    content: '';
    background: rgba(187,17,119,.25);
    position: absolute;
    left: 5px;
    right: 5px;
    height: 100%;
    z-index: 0;
}

.entry * {
    z-index: 2;
    position: relative;
}

.entry .parent {
    margin-top: 10px;
}

.entry:after {
    content: '';
    background: rgba(0,0,0,.5);;
    position: absolute;
    left: 5px;
    right: 5px;
    height: 100%;
    opacity: 1;
    filter: alpha(opacity=100);
    -webkit-transition: opacity 120ms linear;
            transition: opacity 120ms linear;
    top: 0px;
    box-shadow: 0 10px 20px rgba(0,0,0,.25);
    z-index: 1;
}

.entry:hover:after {
    opacity: 0;
    filter: alpha(opacity=0);
}

@media (min-width: 840px) {
#BGofIndex:before, #subtitle, #content {
    width: calc(100% - 80px);
    max-width: 1350px;
}
#entries {
    width: calc(100% - 70px);
    max-width: 1360px;
}
}
}

@-moz-document url-prefix("http://ihome.ust.hk/~msssug/") {
#wrapper {
    display: -webkit-box;
    display: -webkit-flex;
