    -webkit-box-direction: normal;
    -webkit-flex-direction: column;
        -ms-flex-direction: column;
            flex-direction: column;
    -webkit-box-align: center;
    -webkit-align-items: center;
        -ms-flex-align: center;
            align-items: center;
}

#subtitle {
    background-image: url(http://new.ppy.sh/images/headers/tournament.jpg);
    background-size: cover;
    background-position: center;
    -webkit-align-self: center;
    -ms-flex-item-align: center;
    align-self: center;
    margin-left: auto;
    margin-right: auto;
    width: calc(100% - 0px);
    max-width: 1350px;
    box-sizing: border-box;
    padding: 40px 0 20px 0;
    height: 100px;
    background-color: #86e;
    top: -10px;
    left: auto;
    z-index: 1;
    cursor: default;
    box-shadow: 0 1px 3px rgba(0,0,0,.25);
}

#content {
    -webkit-align-self: center;
    -ms-flex-item-align: center;
    align-self: center;
    margin-left: auto;
    margin-right: auto;
    width: calc(100% - 0px);
    max-width: 1350px;
    box-sizing: border-box;
    padding: 20px;
    margin-bottom: 10px;
    margin-top: 0;
    box-shadow: 0 1px 3px rgba(0,0,0,.25);
}

input[type=submit], button {
    height: 2.5em;
    margin-left: 10px;
    min-width: 120px;
    background-color: #4ad;
    box-shadow: 0 10px #29b,0 7px 10px rgba(0,0,0,.8);
    font-size: 12px;
    padding: 10px 20px;
    background-image: url(http://new.ppy.sh/images/backgrounds/button.svg);
    background-size: 200px;
    background-position: 50% 50%;
    color: #fff;
    margin-bottom: 10px;
    -webkit-transition: all .1s ease-in-out;
            transition: all .1s ease-in-out;
    text-shadow: 0 1px 3px rgba(0,0,0,.75);
    display: inline-block;
    font-weight: 400;
    text-align: center;
    vertical-align: middle;
    -ms-touch-action: manipulation;
    touch-action: manipulation;
    cursor: pointer;
    border: 1px solid transparent;
    white-space: nowrap;
    line-height: 1.25;
    border-radius: 4px;
    -moz-user-select: none;
    -webkit-user-select: none;
        -ms-user-select: none;
            user-select: none;
    cursor: pointer;
}

input[type=submit]:hover, button:hover {
	background-color: #2592c9;
    box-shadow: 0 10px #1a7690,0 7px 10px rgba(0,0,0,.8);
}

input[type=submit]:active, button:active {
    -webkit-transform: translate(0,5px);
    -ms-transform: translate(0,5px);
        transform: translate(0,5px);
    background-color: #2592c9;
    box-shadow: 0 5px #1a7690,0 5px 5px rgba(0,0,0,.8);
}

input[type=text] {
    color: #f6a;
    border: 1px solid #ccc;
    padding: 10px 40px 10px 10px;
    font-size: 125%;
    font-style: italic;
    font-weight: lighter;
    -webkit-transition: all 120ms ease-out;
            transition: all 120ms ease-out;
}

input[type=text]:focus {
    outline: 0;
    border: 1px solid #f9c;
    box-shadow: 0 0 10px #fde;
}

textarea {
	padding: 20px 30px;
    box-sizing: border-box;
}
}

@-moz-document url("http://ihome.ust.hk/~msssug/cwiki_home"), url("http://ihome.ust.hk/~msssug/cwiki_home/") {
#content {
    background: transparent;
    box-shadow: none;
    padding: 0;
}

.search, .cwiki_home {
    -webkit-align-self: center;
    -ms-flex-item-align: center;
    align-self: center;
    margin-left: auto;
    margin-right: auto;
    width: 100% !important;
    padding: 20px !important;
    box-shadow: 0 1px 3px rgba(0,0,0,.25);
    background: #fff;
    margin: 0;
    margin-bottom: 10px;
    box-sizing: border-box;
}

.search {
    text-align: left !important;
    color: #f6a;
    font-weight: bold;
    font-size: 110%;
}

.search fieldset {
    border: none;
    padding: 0;
    margin: 0;
}

.search input[type=submit] {
    margin-top: -5px;
}

.cwiki_home {
    padding: 0 !important;
}

#content .cwiki_home h3 {
    background-color: currentColor;
    background-image: url(http://new.ppy.sh/images/headers/forum-category.png);
    background-size: cover;
    background-position: center;
    height: 60px;
    padding: 20px 20px;
    margin: 0;
    color: #fff;
    text-shadow: 0 1px 3px rgba(0,0,0,.75);
    box-sizing: border-box;
}

.cwiki_home:nth-of-type(2) {
    color: #f6a;
}

#content .cwiki_home:nth-of-type(2) h3 {
    background-color: #f6a;
}

.cwiki_home:nth-of-type(2) ul li:after {
    background-color: #f6a;
}

.cwiki_home:nth-of-type(3) {
    color: #86e;
}

