.cwiki_home ul {
    background: #fff;
    list-style: none;
    padding: 5px;
    box-sizing: border-box;
    width: 100%;
}

.cwiki_home ul li {
    position:  relative;
    margin: 5px;
    display: -webkit-flex;
    display: -ms-flexbox;
    display: -webkit-box;
    display: flex;
    -webkit-align-items: stretch;
    -ms-flex-align: stretch;
    -webkit-box-align: stretch;
            align-items: stretch;
    -webkit-justify-content: flex-end;
    -ms-flex-pack: end;
    -webkit-box-pack: end;
            justify-content: flex-end;
    -webkit-box-orient: horizontal;
    -webkit-box-direction: reverse;
            flex-direction: row-reverse;
    -webkit-flex-direction: row-reverse;
    -ms-flex-direction: row-reverse;
    box-shadow: 0 1px 3px rgba(0,0,0,.25);
    height: 50px;
}

.cwiki_home ul li:before {
    left: 0;
    width: 100%;
    content: ' ';
    height: 100%;
    position: absolute;
    top: 0;
    pointer-events: none;
    -webkit-transition: all 125ms ease-out;
            transition: all 125ms ease-out;
}

.cwiki_home ul li:before {
    content: '';
    opacity: 0;
    filter: alpha(opacity=0);
    z-index: 100;
    box-shadow: 0 10px 20px rgba(0,0,0,.25);
}

.cwiki_home ul li:hover:before {
    opacity: 1;
    filter: alpha(opacity=100);
}

.cwiki_home ul li:after {
    position: absolute;
    left: 0;
    top: 0;
    height: 50px;
    line-height: 50px;
    content: ' ';
    width: 10px;
    display: inline-block;
    color: #fff;
    text-align: center;
    vertical-align: middle;
    -webkit-transition: all 125ms ease-out;
            transition: all 125ms ease-out;
}

.cwiki_home ul li:hover:after {
    content: '>';
    width: 18px;
}

.cwiki_home span.l {
    display: block;
    text-transform: uppercase;
    -webkit-flex: none;
    -ms-flex: none;
    -webkit-box-flex: 0;
            flex: none;
    width: 200px;
    background-color: #eee;
    padding: 0 20px;
    line-height: 50px;
    cursor: default;
}

.cwiki_home span.r a {
    position: absolute;
    left: 0px;
    right: 0;
    top: 0;
    bottom: 0;
    color: inherit;
    text-decoration: none;
    display: block;
    padding-left: 28px;
    line-height: 50px;
}

.cwiki_home span.r {
    position: relative;
    overflow: visible;
    color: inherit;
    text-decoration: none;
    display: block;
    background-color: #fff;
    -webkit-flex: 0 1 100%;
    -ms-flex: 0 1 100%;
    -webkit-box-flex: 0;
            flex: 0 1 100%;
    -webkit-align-self: stretch;
    -ms-flex-item-align: stretch;
    align-self: stretch;
}
}

